import React from 'react';

const JoinPresenter = (props) => {
    console.log(props)
    return (
        <div>
            <input type="text" placeholder="아이디를 입력하시오. " onChange={props.inputId(value)} value={props.userId} /><br />
            <input placeholder="비밀번호를 입력하시오." onChange={props.inputPassword} value={props.userPassword} /><br />
            <input placeholder="이름을 입력하시오." onChange={props.inputName} value={props.userName} /><br />
            <button onChange={props.join}>회원가입</button>
        </div>
    );
};

export default JoinPresenter;
